REMARK: Consecutive relationships are defined at http://www.xbrl.org/Specification/XDT-REC-2006-09-18.htm#_2.1.1 and consist only of the following initial-following arc role
pairs: all, hypercube-dimension; not-all, hypercube-dimension; hypercube-dimension, dimension-domain; dimension-domain, domain-member;
domain-member, domain-member. Note that domain-member is never followed by all, not-all, or any arcrole other than domain-member.
